import React from "react";

function PopupWithForm(props) {
  const className = ``
  return(
    <section className={`popup popup_theme_${props.name}`}>
      <div className="popup__container">
        <button type="button" className="button popup__close">
        </button>
        <form className={`popup__content popup__content_theme_${props.form}`} noValidate>
          <h2 className="popup__title popup__title_theme_profile">{props.title}</h2>
          <div className="popup__fields">
            {props.children}
            <button type="submit" className="button button_submit">
              Сохранить
            </button>
          </div>
        </form>
      </div>
    </section>
  );
}

export default PopupWithForm;
